import {Routes, Route} from "react-router-dom";
import Home from "./Home"
import Login from "./Login";


function WebRoutes(){


    return(
    <Routes>
        <Route exact path="/" element={<Home />}></Route>
        <Route exact path="/" element={<Login />}></Route>
    </Routes>
    )
}


export default WebRoutes;
